import React, { useEffect, useState } from "react";

function CoinCourse() {
  const [answer, setAnwser] = React.useState([]);

    useEffect(() => {
        fetch("http://api.coinlayer.com/api/live?access_key=eeab1dedc42f30071b67a319c39138bf")
        .then(response => response.json())
        .then(answer => setAnwser(answer))
    }, []);

        let arr = answer.rates;
        const resArray = []; 
        resArray.push(arr); 
        console.log(resArray);

        return (
            
        <div>
            {resArray === undefined ? (<h2>Empty...</h2>) :
          (<ul>
            {resArray && resArray.map((item, index) => <li key={index}>BTC - {item.BTC}$</li>)}
          </ul>)   
            }
        </div>  
        );

}
export default CoinCourse;
